import React from 'react';
import './SideNavBar.css';

const SideNavBar = () => {
    return (
        <div className="sideNavBar">
            <button className="navItem">Customers</button>
            <button className="navItem">Jobs</button>
            <button className="navItem">Map View</button>
            <button className="navItem">Google Reviews</button>
            <button className="navItem">Image Uploader</button>
            <button className="navItem">Settings</button>
            <button className="navItem">Log Out</button>
        </div>
    );
};

export default SideNavBar;
